import React from "react";
export default class Coin extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            coins : []
        }
        
    }
   
    componentDidMount(){
        let headersList = {
            "Accept": "*/*",
            "User-Agent": "Thunder Client (https://www.thunderclient.com)",
            "Authorization": "Bearer "+localStorage.getItem('token')
           }
           
           fetch("http://localhost:8089/api/coin/getAllCoin", { 
             method: "GET",
             headers: headersList
           }).then(function(response) {
            this.setState({
                coins: response,
            });
             return response.text();
           }).then(function(data) {
             console.log(data);
           })
           
    }
    render(){
        return 
        <div> 
            <h1>Coin List</h1>
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>CoinId</th>
                            <th>CoinName</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.coins.map(
                        coin =>
                        <tr key = {coin.coinId}>
                            <td>{coin.coinId}</td>
                            <td>{coin.coinName}</td>
                            <td>{coin.price}</td>
                        </tr>
                            )
                        }
                    </tbody>
            </table>
   </div>
    }
}
